import './App.css';
import Navbar from "./components/Navbar";
import Login from "./pages/Login";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";

const App =() => {
    const user = true;
return (
    <BrowserRouter>
        <div>

    <Navbar/>
    <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/task" element={user ? <Navigate to="/" /> : <Login />} />
    </Routes>

</div>
</BrowserRouter>)
};

export default App;
